description:
Will Hunting ar en 20-aring vars vardag kantas av slagsmal, skitjobb och
pubrundor med polarna. Men Will ar annorlunda. Han ar overinteligent,
har fotografiskt minne och kan losa matematiska problem som t.o.m.
Nobelpristagare gar bet pa.
Med bl.a. Robin Williams, Matt Damon, Ben Affleck, Minnie Driver och
Stellan Skarsgard.
